function Auth(){}Auth.prototype.loginAuth=function(){$(".loginBtn").click(function(n){n.preventDefault();var e=$('input[name="telephone"]').val(),o=$('input[name="password"]').val(),t=$('input[name="remember"]').prop("checked");xfzajax.post({url:"/auth/login/",data:{telephone:e,password:o,remember:t},success:function(n){200===n.code?window.location.href="/cms/index/":(messageBox.showError("用户名或者密码错误"),console.log(n.message))}})})},Auth.prototype.run=function(){this.loginAuth()},$(function(){(new Auth).run()});